from sympy import factorint
from math import prod
def a(n) -> int:
    v = lambda p: (1-p)//2 if p&2 else (1+p)//2
    h = lambda n: prod(v(p)**e for p, e in factorint(n).items())
    return h(2*n+1)
print([a(n) for n in range(60)])  # _David Radcliffe_, Jun 04 2025

